                    return <li>{c}</li>;
                  })
                : null}
            </ul>
          ) : null}
          {education.mathCourses ? (
            <ul className="edu-math item-ul">
              Math courses
              <span
                className="expand-button cursor"
                onClick={() => setShowMath(!showMath)}
              >
                {showMath ? "-" : "+"}
              </span>
              {showMath
                ? education.mathCourses.map((c) => {
                    return <li>{c}</li>;
                  })
                : null}
            </ul>
          ) : null}
        </div>
      ) : null}
    </div>
  );
}

export default Experience;
